package Lec1;

public class Arithmetic_Operators {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 8;
		int b = 9;
		int c = a + b;
		System.out.println(c);
		c = a - b;
		System.out.println(c);
		c = a * b;
		System.out.println(c);
		c = a / b;
		System.out.println(c);
		c = a % b;
		System.out.println(c);
	}
}
